import { Component, OnInit, ViewChild } from '@angular/core';
import { FormControl } from '@angular/forms';
import { DatabaseService } from '../core/database.service';
import { MatSnackBar, MatDialog, MatTableDataSource, MatPaginator, MatSort } from '@angular/material';
import { Observable } from 'rxjs';
import { startWith, map } from 'rxjs/operators';

import * as jsPDF from 'jspdf';
import { AuthService } from '../core/auth.service';

@Component({
  selector: 'app-stock',
  templateUrl: './stock.component.html',
  styles: []
})

export class StockComponent implements OnInit {

  disableTooltips   = new FormControl();
  loading: boolean = false;
  generated: boolean = false;
  generateButtonDisabled: boolean = true;

  filteredWarehouses: Array<any> = [];
  filteredProducts: Array<any> = [];
  productsWithoutDucplicates: Array<any> = [];

  displayedColumns: string[] = ['index', 'name', 'stock'];
  dataSource = new MatTableDataSource();

  @ViewChild(MatPaginator) paginator: MatPaginator;
  @ViewChild(MatSort) sort: MatSort;

  selectedType = new FormControl('');

  warehouseField = "";
  warehouseFromList = new FormControl();
  filteredWarehouseOptions: Observable<any>;
  selectedWarehouse: object = {};

  productField = "";
  productFromList = new FormControl();
  filteredProductOptions: Observable<any>;
  selectedProduct: object = {};

  constructor(
    public dbs: DatabaseService,
    public auth: AuthService,
    public snackbar: MatSnackBar,
    public dialog: MatDialog
  ) { 
    
  }

  ngOnInit() {

    this.dbs.currentDataWarehouses.subscribe( res => {
      this.filteredWarehouses = res;
      this.dataSource.data = this.filteredWarehouses;
    });

    this.dbs.currentDataProducts
    .pipe(
      map( res => {
        let withoutDuplicates = [];        

        res.forEach( element => {

          let tempResults = withoutDuplicates.filter( option => 
            option['name'].includes(element['name']));

          if(tempResults.length === 0){
            withoutDuplicates.push(element);
          }

        });

        return withoutDuplicates;
      })
    )
    .subscribe( res => {
      this.productsWithoutDucplicates = res;
      this.filteredProducts = res;
      this.dataSource.data = this.filteredProducts;
    });

    this.dataSource.paginator = this.paginator;
    this.dataSource.sort = this.sort;

    this.filteredWarehouseOptions = this.warehouseFromList.valueChanges
      .pipe(
        startWith(''),
        map(value => this._filterWarehouses(value))
      );

    this.filteredProductOptions = this.productFromList.valueChanges
      .pipe(
        startWith(''),
        map(value => this._filterProducts(value))
      );

  }

  // STOCK BY WAREHOUSE

  private _filterWarehouses(value): any {
    const filterValue = (typeof value === 'object')? value['name'].toLowerCase() : value.toLowerCase();
    return this.dbs.warehouses.filter(option => option['name'].toLowerCase().includes(filterValue));
  }

  filterWarehousesData(ref): void {
    ref = ref.toLowerCase();

    this.filteredWarehouses = this.dbs.warehouses.filter( option => 
      option['name'].toLowerCase().includes(ref));

    this.dataSource.data = this.filteredWarehouses;
  }

  setWarehouseField(warehouse): void {
    if(typeof warehouse === 'object'){
      this.generateButtonDisabled = false;
      this.displayedColumns = ['index', 'name', 'stock'];
      this.selectedWarehouse = warehouse;
    }
  }

  showWarehouseSelected(warehouse): string | undefined {
    return warehouse? warehouse['name'] : undefined;
  }

  // STOCK BY PRODUCT
  private _filterProducts(value): any {
    const filterValue = (typeof value === 'object')? value['name'].toLowerCase() : value.toLowerCase();
    return this.productsWithoutDucplicates.filter(option => option['name'].toLowerCase().includes(filterValue));
  }

  filterProductData(ref): void {
    ref = ref.toLowerCase();

    this.filteredProducts = this.productsWithoutDucplicates.filter( option => 
      option['name'].toLowerCase().includes(ref));

    this.dataSource.data = this.filteredProducts;
  }

  setProductField(product): void {
    if(typeof product === 'object'){
      this.generateButtonDisabled = false;
      this.displayedColumns = ['index', 'warehouse', 'name', 'stock'];
      this.selectedProduct = product;
    }
  }

  showProductSelected(product): string | undefined {
    return product? product['name'] : undefined;
  }

  generate(): void{

    this.loading = true;
    this.generated = false;

    if(this.selectedType.value === 'warehouse'){

      this.dbs.currentDataProducts
        .pipe(
          map( res => {
            let productList = [];
            let counter = 1;
            res.forEach( element => {
              if(element['warehouse'] === this.warehouseFromList.value['name']){
                element['index'] = counter;
                productList.push(element);
                counter++;
              }
            })
            return productList;
          })
        )
        .subscribe( res => {
          this.dataSource.data = res;
          this.loading = false;
          this.generated = true;
        })
    }

    if(this.selectedType.value === 'product'){
      
      this.dbs.currentDataProducts
        .pipe(
          map( res => {
            let productList = [];
            let counter = 1;
            res.forEach( element => {
              if(element['name'] === this.productFromList.value['name']){
                element['index'] = counter;
                productList.push(element);
                counter++;
              }
            })
            return productList;
          })
        )
        .subscribe( res => {
          this.dataSource.data = res;
          this.loading = false;
          this.generated = true;
        })
    }

  }

  download(): void{
    let doc = new jsPDF();
    let date = new Date();
    let pageCounter = 1;

    let logo = "data:image/png;base64,"
    
    if(this.auth.userInvent.accountType === 3){
      if(this.dbs.company['logo'] != ''){
        logo = this.dbs.company['logo'];
      }else{
        this.snackbar.open("Aun no se ha cargado el logo de la empresa, se utilizará el logo por defecto de softinvent", "Cerrar", {
          duration: 8000
        })
      }
      
    }

    let firstPage = true;

    let totalPages = Math.ceil(this.dataSource.data.length/25);

    for (let index = 0; index < this.dataSource.data.length; index++) {

      if(index % 25 === 0){

        if(firstPage === false){
          pageCounter++;
          doc.addPage();
        }

        doc.addImage(logo,'JPEG', 10, 10, 35, 9);
        doc.setTextColor(52,73,94);
        doc.setFontSize(25);
        doc.setFontStyle("bold");
        doc.text('STOCK', 80, 17);

        doc.setFontStyle("normal");
        doc.setFontSize(10);

        if((date.getMonth()+1) < 10){
          doc.text("Fecha: " + date.getDate()+"-0"+(date.getMonth() + 1)+"-"+date.getFullYear(), 160, 10);
        }else{
          doc.text("Fecha: " + date.getDate()+"-"+(date.getMonth() + 1)+"-"+date.getFullYear(), 160, 10);
        }

        doc.text("Hora: "+date.getHours()+" : "+date.getMinutes()+" : "+date.getSeconds(), 160, 15);
        doc.text("Pag.: " + pageCounter + "/" + totalPages, 160, 20);
        
        
        doc.line(10, 24, 200, 24);

        doc.setFontSize(12);
        doc.setFontStyle("bold");
        doc.text("N°", 10, 32);
        doc.text("Almacén", 25, 32);
        doc.text("Producto", 65, 32);
        doc.text("Stock", 100, 32);
        doc.text("Estado", 125, 32);

        doc.setFontSize(10);
        doc.setFontStyle("normal");

        firstPage = false;
      }

      doc.text(""+(index+1), 10, 42 + ((index%25)*10));
      doc.text(""+this.dataSource.data[index]['warehouse'], 25, 42 + ((index%25)*10));
      doc.text(""+this.dataSource.data[index]['name'], 65, 42 + ((index%25)*10));
      doc.text(""+this.dataSource.data[index]['stock'], 100, 42 + ((index%25)*10));
      doc.text("---", 125, 42 + ((index%25)*10));

      // doc.text(""+(index), 10, 32 + (pageCounter > 1?10:0) + ((index%25)*10));
      // doc.text("TDA 410", 25, 32 + (pageCounter > 1?10:0) + ((index%25)*10));
      // doc.text("Antare", 65, 32 + (pageCounter > 1?10:0) + ((index%25)*10));
      // doc.text(""+((index%25)*10), 100, 32 + (pageCounter > 1?10:0) + ((index%25)*10));
      // doc.text("OK", 125, 32 + (pageCounter > 1?10:0) + ((index%25)*10));

    }

    let docName = this.selectedType.value==='warehouse'?this.selectedWarehouse['name']:this.selectedProduct['name'];

    doc.save('stock_'+ docName + '_'+date.getDate()+(date.getMonth()+1)+date.getMonth()+date.getFullYear()+date.getHours()+date.getMinutes()+'.pdf');
  }
}
